import { useEffect, useRef, useState } from "react";
import StarRating from "./components/StarRating";
import { useKey } from "./hooks/useKey";
import { useLocalStorageState } from "./hooks/useLocalStorageState";
import { BookHaven } from "./hooks/useBooks";
import { useDebounce } from "./hooks/useDebounce";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

export default function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/my-book-list" element={<MyBookList />} />
      </Routes>
    </Router>
  );
}

function Home() {
  const [query, setQuery] = useState("");
  const [selectedId, setSelectedId] = useState(null);
  const debouncedQuery = useDebounce(query, 500);
  const { books, isLoading, error } = useBooks(debouncedQuery);
  const [read, setRead] = useLocalStorageState([], "read");
  const [recommendedBooks, setRecommendedBooks] = useState([]);

  useEffect(() => {
    async function fetchRecommendedBooks() {
      try {
        const res = await fetch(
          "https://www.googleapis.com/books/v1/volumes?q=subject:fiction"
        );
        const data = await res.json();
        setRecommendedBooks(data.items || []);
      } catch (err) {
        console.error("Failed to fetch recommended books:", err);
      }
    }
    fetchRecommendedBooks();
  }, []);

  function handleSelectBook(id) {
    setSelectedId((selectedId) => (id === selectedId ? null : id));
  }

  function handleCloseBook() {
    setSelectedId(null);
  }

  function handleAddRead(book) {
    setRead((prevRead) => {
      const updatedRead = [...prevRead, book];
      localStorage.setItem("read", JSON.stringify(updatedRead));
      return updatedRead;
    });
  }

  function handleDeleteRead(id) {
    setRead((read) => read.filter((book) => book.id !== id));
  }

  useEffect(() => {
    const storedRead = JSON.parse(localStorage.getItem("read")) || [];
    setRead(storedRead);
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <Search query={query} setQuery={setQuery} />
      <NumResults books={books} />
      <Main>
        <Box>
          {isLoading && <Loader />}
          {!isLoading && !error && (
            <>
              {books.length === 0 && query === "" ? (
                <BookList
                  books={recommendedBooks}
                  onSelectBook={handleSelectBook}
                />
              ) : (
                <BookList books={books} onSelectBook={handleSelectBook} />
              )}
              {error && <ErrorMessage message={error} />}
            </>
          )}
        </Box>
        <Box>
          {selectedId ? (
            <BookOverlay
              selectedId={selectedId}
              onCloseBook={handleCloseBook}
              onAddRead={handleAddRead}
              read={read}
            />
          ) : (
            <>
              <Summary read={read} />
              <BookList books={read} onSelectBook={handleSelectBook} />
            </>
          )}
        </Box>
      </Main>
    </div>
  );
}

function MyBookList() {
  const [read, setRead] = useLocalStorageState([], "read");

  function handleDeleteRead(id) {
    setRead((read) => read.filter((book) => book.id !== id));
  }

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <h1 className="text-2xl font-bold mb-4">My Book List</h1>
      <BookList books={read} onDeleteRead={handleDeleteRead} />
    </div>
  );
}

function NavBar() {
  return (
    <nav className="bg-blue-600 text-white p-4 flex justify-between">
      <Link to="/" className="font-bold text-lg">
        Home
      </Link>
      <Link to="/my-book-list" className="font-bold text-lg">
        My Book List
      </Link>
    </nav>
  );
}

function Search({ query, setQuery }) {
  return (
    <input
      type="text"
      value={query}
      onChange={(e) => setQuery(e.target.value)}
      placeholder="Search for books..."
      className="w-full p-2 border border-gray-300 rounded"
    />
  );
}

function NumResults({ books }) {
  return (
    <p className="text-gray-600">
      {books.length > 0 ? `Found ${books.length} results` : "No results found"}
    </p>
  );
}

function Main({ children }) {
  return <div className="flex space-x-4">{children}</div>;
}

function Box({ children }) {
  return (
    <div className="bg-white p-4 rounded shadow-md w-full">{children}</div>
  );
}

function Loader() {
  return <div className="text-center">Loading...</div>;
}

function ErrorMessage({ message }) {
  return <div className="text-center text-red-600">{message}</div>;
}

function BookList({ books, onSelectBook, onDeleteRead }) {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
      {books.map((book) => (
        <Book
          key={book.id}
          book={book}
          onSelectBook={onSelectBook}
          onDeleteRead={onDeleteRead}
        />
      ))}
    </div>
  );
}

function Book({ book, onSelectBook, onDeleteRead }) {
  const { title, authors, imageLinks } = book.volumeInfo || {};

  return (
    <div className="bg-white p-4 rounded shadow-md">
      <img
        className="w-full h-64 object-cover rounded"
        src={imageLinks?.thumbnail}
        alt={`${title} cover`}
      />
      <h3 className="mt-2 text-lg font-bold">{title}</h3>
      <p className="text-gray-600">{authors?.join(", ")}</p>
      <div className="mt-2 flex justify-between items-center">
        <button
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 transition duration-200"
          onClick={() => onSelectBook(book.id)}
        >
          View
        </button>
        {onDeleteRead && (
          <button
            className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700 transition duration-200"
            onClick={() => onDeleteRead(book.id)}
          >
            Delete
          </button>
        )}
      </div>
    </div>
  );
}

function Summary({ read }) {
  const totalBooks = read.length;
  const avgRating =
    read.reduce((acc, book) => acc + (book.userRating || 0), 0) / totalBooks;

  return (
    <div className="bg-white p-4 rounded shadow-md">
      <h3 className="text-lg font-bold">Summary</h3>
      <p className="text-gray-600">Total Books: {totalBooks}</p>
      <p className="text-gray-600">Average Rating: {avgRating.toFixed(2)}</p>
    </div>
  );
}
